(6203, 'INSERT INTO pravno_savjetovanje_pitanje (razlog, opis, datum_vrijeme_postavljanja, odvjetnik_id, korisnik_id) VALUES (\'Granice katastra\', \'Poštovani,\nNedavno smo kupili zemljište i upisali se u katastar i zemljišne knjige. Te iste godine se pored naseg zemljišta gradio novi nogostup. Prilikom njegove izgradnje graditelji su poštivali iskolčenje te ga napravili cca 2m od naše živice. Živica nije stvarna granica našeg zemljišta, nego od nje imamo jos recimo tih 2m.\n\nKome se obratiti da se ovo ispravi? Ucrtano ne prati realno stanje\n\nHvala na odgovoru, lp.\', \'2022-06-14 15:52:06\', 102, 101)', NULL, '2022-06-14 15:52:06', 2, 101),
