(6567, 'INSERT INTO pravno_savjetovanje_pitanje (razlog, opis, datum_vrijeme_postavljanja, odvjetnik_id, korisnik_id) VALUES (\'Prodaja terase\', \'Postovani,\n\nNaš neboder ima 68 stanova i 7 poslovnih prostora u vlasnistvu Grada Zagreba. imamo terasu koja je godinama bila neprohodna i leglo okupljanja smeca i hrane koja je letila iz stanova.\n\nnakon obnove terasa je postala prohodna i s ogradom. pitanje je smiju li stanari kupiti od zgrade svoj dio terase s obzirom da nitko drugi osim njih ne moze doci na terasu, te kako se krecu cijene.\', \'2022-06-14 16:02:44\', 2, 137)', NULL, '2022-06-14 16:02:44', 2, 137),
