(6616, 'INSERT INTO pravno_savjetovanje_pitanje (razlog, opis, datum_vrijeme_postavljanja, odvjetnik_id, korisnik_id) VALUES (\'Predmeti na dobivenoj čestici\', \'Poštovani\n\nZanima me slučaj gdje je proveden postupak uređenja međe, jednoj strani je pripalo 2m zemljišta od druge strane. Druga strana je imala na tom djelu svoje predmete (stupove betonske, drvene) i strana koja je dobila mjerenjem tih 2m prisvojila je i navedene predmete s porukom kao to sam dobio sa zemljom. Da li je to ispravno ?\', \'2022-06-14 16:03:54\', 2, 137)', NULL, '2022-06-14 16:03:54', 2, 137),
(6617, 'SELECT psp.razlog,psp.opis,psp.datum_vrijeme_postavljanja,psp.odvjetnik_id,k1.ime_prezime AS ime_prezime_klijenta,k2.ime_prezime AS ime_prezime_odvjetnika,pso.tekst FROM pravno_savjetovanje_pitanje psp LEFT JOIN pravno_savjetovanje_odgovor pso ON psp.pitanje_id=pso.pitanje_id JOIN korisnik k1 ON k1.korisnik_id=psp.korisnik_id JOIN korisnik k2 ON k2.korisnik_id=psp.odvjetnik_id WHERE psp.korisnik_id=137 AND psp.odvjetnik_id=2 AND psp.razlog LIKE \'%%\' LIMIT 999999999 OFFSET 0', NULL, '2022-06-14 16:03:54', 2, 137),
