(6677, 'INSERT INTO pravno_savjetovanje_pitanje (razlog, opis, datum_vrijeme_postavljanja, odvjetnik_id, korisnik_id) VALUES (\'Punomoć\', \'Poštovani,\n\nOtac i stric su potpisali ugovor o doživotnom uzdržavanju prije par godina. Sada su napravili aneks tog ugovora te su ga predali na sud radi ovjere te su pozvani da pristupe na ročište. U pozivu piše da umjesto stranke na ročište može pristupiti ovlašteni punomoćnik. Znači li to da se punomoćnik može potpisati u njihovo ime? Može li punomoćnik biti jedna te ista osoba za obojicu i potpisati se u njihovo ime?\n\nHvala na odgovoru, lp.\', \'2022-06-14 16:06:57\', 2, 137)', NULL, '2022-06-14 16:06:57', 2, 137),
