(6839, 'INSERT INTO pravno_savjetovanje_pitanje (razlog, opis, datum_vrijeme_postavljanja, odvjetnik_id, korisnik_id) VALUES (\'Troškovi suda\', \'Poštovani,\n\nzanima me kako se računaju troškovi parnice nakon što je tužba dobivena? Ja sam uspio u tužbi 80 %.\n\nOdvjetnik mi je rekao da tuženik plaća 80 % troškova.Što su to točno troškovi parnice, sudski troškovi, ili troškovi suda i odvjetnika zajedno?\n\nI kako se obračunavaju odvjetnički troškovi, po kojoj tarifi?\n\nHvala na odgovoru, lp.\', \'2022-06-14 16:11:44\', 101, 137)', NULL, '2022-06-14 16:11:44', 2, 137),
