(6841, 'SELECT psp.razlog,psp.opis,psp.datum_vrijeme_postavljanja,psp.odvjetnik_id,k1.ime_prezime AS ime_prezime_klijenta,k2.ime_prezime AS ime_prezime_odvjetnika,pso.tekst FROM pravno_savjetovanje_pitanje psp LEFT JOIN pravno_savjetovanje_odgovor pso ON psp.pitanje_id=pso.pitanje_id JOIN korisnik k1 ON k1.korisnik_id=psp.korisnik_id JOIN korisnik k2 ON k2.korisnik_id=psp.odvjetnik_id WHERE psp.korisnik_id=137 AND psp.odvjetnik_id=101 AND psp.razlog LIKE \'%%\' LIMIT 5 OFFSET 0', NULL, '2022-06-14 16:11:44', 2, 137),
