(6925, 'INSERT INTO pravno_savjetovanje_pitanje (razlog, opis, datum_vrijeme_postavljanja, odvjetnik_id, korisnik_id) VALUES (\'Kako upisati zamijenjenu nekretninu?\', \'Poštovani,\n\nimam nekoliko pitanja za vas. Moj otac je za vrijeme rata zamijenio zemljište u Banjoj Luci za nedovršenu vikend kuću u blizini Šibenika. On tu nekretninu nije upisao na sebe,a nedavno je umro. Brat i ja smo naslijedili tu kuću u istim dijelovima. Kako nekretninu upisati na nas s obzirom da imamo samo ugovor o zamjeni. Podnijela sam i zahtjev za legalizaciju ove nekretnine. \n\nHvala\', \'2022-06-14 16:15:37\', 101, 137)', NULL, '2022-06-14 16:15:37', 2, 137);
