INSERT INTO `kategorija_sudskog_postupka` (`kategorija_sudskog_postupka_id`, `naziv`, `opis`) VALUES
(1, 'Promet', 'Odnosi se na pravna pitanja vezana uz zračni, cestovni i pomorski promet, te samu industriju prometa'),
(2, 'Nekretnine', 'Odnosi se na sva pitanja vezana uz čestice zemljišne površine i vlasništvo nad njima'),
(3, 'Zaštita osobnih podataka', 'Odnosi se na pitanja vezana uz uskraćivanje osnovinh prava zaštite privatnog života i narušavanja ostalih ljudskih sloboda u prikupljanju, obradi i korištenju osobnih podataka'),
(4, 'Obrazovanje', 'Odnosi se na pravna pitanja vezana uz djelovanje obrazovnih ustanova i provođenja procesa obrazovanja u njima'),
(5, 'Trgovina', 'Odnosi se na pravna pitanja vezana uz reguliranje subjekata trgovačkog prava i pravnih poslova trgovačkog prava'),
(6, 'Zdravstvo', 'Odnosi se na pravna pitanja vezana uz načela i mjere zdarvstvene zaštite, te prava na zdravstvenu skrb'),
(7, 'Građevina', 'Odnosi se na pravna pitanja vezana uz građevinska prava koja uređuju javnopravnu materiju u području građevinarstva i ona koja opisuju odnose između fizičkih i pravnih osoba u skladu s načelom ravnopravnosti'),
(8, 'Mediji', 'Odnosi se na pravna pitanja vezana uz ostvarivanje načela slobode medija, prava novinara i drugih sudionika u javnom informiranju'),
(9, 'Obitelj', 'Odnosi se pravna pitanja vezana uz skup pravnih načela kojima se uređuju obiteljski odnosi, tj. osobnopravni i imovinskopravni odnosi članova obitelji te članova obitelji prema trećim osobama'),
(10, 'Prehrana', 'Odnosi se na pravna pitanja vezana uz proizvodnju, deklaraciju i korištenje prehrambenih proizvoda');
