INSERT INTO `obrana` (`obrana_id`, `argumenti_obrane`, `zahtjev_id`) VALUES
(9, 'Klijent je zbog nužne situacije žurio za vozilom hitne pomoći ćemu mogu svjedočiti njegova žena i liječnik.', 2),
(10, 'Klijent nije mogao biti svjestan isteka potvrde jer su u svakom koraku izgradnje nove nekretnine svi građevisnki radnici i referenti potvrdili valjanost iste potvrde', 6),
(11, 'Klijent je žurio po svoje maloljetno dijete u vrtić.', 7),
(12, 'Klijent je bio na 3-tjednom poslovnom putovanju u inozemstvu.', 13),
(13, 'Klijent nije mogao znati da je pošta tuđa jer ima isto ime kao i pravi primatelj pošte', 20),
(14, 'Klijent je smatrao kako nešto nije u redu s njegovim vozilom, te je smatrao kako će na ovaj način izbjeći sve moguće opasnosti na cesti', 18),
(15, 'Na snimci nadzorne kamere jasno se vidi vozilo, no ne i vozač stoga se ne može bez sumnje utvrditi krivica', 25),
(16, 'Klijent smatra da se nije mogao sigurno zaustaviti zato što je vozilo iza njega bilo na premaloj udaljenosti, što je također vidljivo na nadzornoj kameri ', 24),
(17, 'Klijent je žurio kako bi se maknuo hitnoj pomoći s ceste uslijed čega ga je uhvatila nadzorna kamera', 11),
(18, 'Kako bi izbjegao pijanog vozača, klijent je kontaktirao policiju i pretekao ga kako bi ga usporio', 12),
(19, 'Klijent je još uvijek u periodu kada može zamijeniti registraciju iako je istekla stoga se slučaj treba odbaciti', 21),
(20, 'Priložene kazne nisu propisane po standardu stoga se moraju odbaciti', 30),
(21, 'Kamp kućica nema mogućnost prijevoza stoga se mora vodoiti kao nekretnina što piše u riješenju prijašnjeg sudskog postupka poduzetog protiv klijenta', 28),
(22, 'Ostavština je bila usmena, a prijepis se pojavio naknadno i ne može se validirati njegova valjanost', 16),
(23, 'U usmenom dogovoru s prodavateljem kuće, klijent je doselio', 26),
(24, 'Garaža nije u vlasništvu klijentice već je u vlasništvu bivšeg vlasnika kuće koji garažu nije prijavi', 3),
(25, 'Klijentica nije dužna snositi kaznenu odgovornost jer nije primila nijedno pismeno upozorenje na neplaćanje', 5),
(26, 'Potvrda još uvijek vrijedi jer je datum za legalizaciju 1970. godina što je očita računalna greška', 8),
(27, 'Klijentica je proširila okolni dio dvorišta bez konzultacije susjednih stanara jer je imovina njena', 15),
(28, 'Klijentovo računalo nema tragove korištenja za ovakav napad', 29),
(30, 'Iako je tehnički na posjedu rada, okućnica pripada klijentici', 14);
INSERT INTO `pravno_savjetovanje_odgovor` (`odgovor_id`, `tekst`, `datum_vrijeme_odgovaranja`, `pitanje_id`) VALUES
(38, '90 dana.', '2022-06-14 15:53:06', 91),
(39, 'Zato što je to krajnji rok u kojemu policijska uprava mora izdati osobnu iskaznicu ukoliko joj je predan uredno kompletiran zahtjev za izdavanje nove.', '2022-06-14 15:53:22', 93),
(40, 'Člankom 6. Zakona o putnim ispravama hrvatskih državljana propisano je da građanin mlađi od 14 godina može putovati u inozemstvo samo u pratnji roditelja ili drugog zakonskog zastupnika, ili uz njihovu suglasnost u pratnji druge osobe.', '2022-06-14 15:53:34', 96),
(41, 'Na ročištu, zatraži od sudca da inzistiraš da ti se od strane suda ispostavi takav zahtijev prema tvrtki. Kad sud izda nalog morati će! To je jednini način da privatno lice dođe do dokaza. nema druge.', '2022-06-14 15:56:03', 92),
(42, 'Za početak tražiti od predstavnika stanara da ih upozori na ponašanje, a ako ne bude učinka onda im se pravna služba upravitelja može obratiti pisanim putem i upozoriti ih na kršenje kućnog reda zgrade.', '2022-06-14 15:56:22', 95),
(43, 'Nikako, nema registra i neće ti reći.', '2022-06-14 15:56:42', 100),
(44, 'Zaposlenik kojem poslodavac otkazuje nakon dvije godine neprekidnog rada ima pravo na otpremninu u iznosu koji se određuje s obzirom na dužinu prethodnog neprekinutog trajanja radnog odnosa s tim poslodavcem.', '2022-06-14 15:58:59', 73),
(45, 'Ovršni zakon,\nZakon o javnim ovršiteljima,\nZakon o provedbi ovrhe na novčanim sredstvima.', '2022-06-14 15:59:53', 76),
(46, 'Nakon pola kazne.', '2022-06-14 16:00:39', 80),
(47, 'Bilo tko, ako dobije dozvolu od suda.', '2022-06-14 16:01:33', 82),
(48, 'Cijene variraju od ureda do ureda, ovisno i o veličini objekta. \n\nSvakako se raspitajte u više ureda, većinom svi oni rade u &#34;paru&#34;.', '2022-06-14 16:03:26', 105),
(49, 'Jednostavno društvo s ograničenom odgovornošču može imati do 3 osnivača i samo jednog člana uprave - direktora koji zastupa tvrtku.Za zastupanje može se odlukom direktora dodijeliti prokura nekoj osobi.Prokurist ima ovlasti zastupati tvrtku, jedino što ne može je prodavati imovinu tvrtke niti pokretati stečaj, likvidaciju i slično.', '2022-06-14 16:06:17', 78),
(50, 'Kontaktirajte HEP pisanim putem vezano uz navedene čestice, da vidite možete li s njima mirno riješiti spor glede premještaja vodova, odnosno zabrane prodaje, ako ista postoji na čestici, možda će oni imati više informacija.', '2022-06-14 16:10:55', 104),
(51, 'Ne mijenja. Rješenjem o utvrđivanju građevne čestice će vjerovatno dobiti česticu zgrade (sa*).', '2022-06-14 16:11:41', 106),
(52, 'Odredbe ovoga Zakona primjenjuju se u svim djelatnostima u kojima radnici obavljaju poslove za poslodavca. Iznimke za samozaposlene osobe.', '2022-06-14 16:13:21', 83),
(53, 'Primarno će se cijeniti kao dokaz iskaz dan na sudu, a tamo će se svjedocima dati mogućnost da se očituju i objasne i te poruke.\n \nPlus ostaje upitnim način na koji ste došli do tih poruka, ukoliko nisu bile upućene vama.', '2022-06-14 16:13:42', 84),
(54, 'Godinu od dospijeća, ako nije pokrenut ovršni postupak.', '2022-06-14 16:14:05', 89),
(55, 'Par mjeseci.', '2022-06-14 16:15:00', 88),
(56, 'Nije ispravno jer se radi o tuđoj imovini koja je odvojiva od zemljišne čestice.', '2022-06-14 16:17:22', 108),
(58, 'Punomočnik se nikad nepotpisuje u tuđe ime,več isključivo stavlja svoj osobni potpis,npr Marković Marko po punomočniku Ivi Iviću(Ivo se potpisuje svojim potpisom)', '2022-06-14 16:18:57', 109),
(59, 'Ne mogu tvrditi da je tako i u Vašoj zgradi, to biste mogli provjeriti u međuvlasničkom ugovoru, da terasa pripada u zajedničke dijelove zgrade, kao i stubišta, podrum, tavan, uređaji u zgradi i slično. Ako je tako, onda imate pravo na korištenje terase zajedno sa svim drugim suvlasnicima u zgradi sukladno odredbama međuvlasničkog ugovora.', '2022-06-14 16:19:24', 107),
(60, 'Sve kao da tek želite istu graditi ako je do 50 m2, glavni projekt, potvrda istog od strane javnopravnih tijela, provedba kroz katastar i ZK te uporaba dozvola, + kazna za zadržavanje objekta.', '2022-06-14 16:20:46', 87),
(61, 'Da, prijepis je moguć', '2022-06-14 20:12:30', 90);
INSERT INTO `pravno_savjetovanje_pitanje` (`pitanje_id`, `razlog`, `opis`, `datum_vrijeme_postavljanja`, `odvjetnik_id`, `korisnik_id`) VALUES
(73, 'Zakon o radu', 'Kada radnik ima pravo na otpremninu, i koliko ona iznosi?', '2022-06-14 15:22:36', 1, 139),
(74, 'Vrste otkaza', 'Pozdrav, zanima me koje sve vrste otkaza postoje i koje su obaveze poslodavca?', '2022-06-14 15:23:52', 1, 101),
(75, 'Starost bjanko zadužnice', 'Koliko smije biti stara bjanko zadužnica kako bi bila valjana i koji su uvjeti?', '2022-06-14 15:25:05', 1, 101),
(76, 'Regulacija ovrhe', 'Koji zakoni reguliraju ovrhe?', '2022-06-14 15:25:14', 1, 138),
(77, 'Plaća', 'Koliku plaću si mora isplaćivati član uprave? Kako to djeluje na osnovicu?', '2022-06-14 15:26:20', 1, 101),
(78, 'Zastupanje društva od strane treće osobe', 'Na koji način osnivač i direktor može drugom članu obitelji dati trgovačku punomoć?', '2022-06-14 15:26:57', 1, 139),
(79, 'Troškovi zatvaranja', 'Koliki su troškovi zatvaranja j.d.o.o., d.o.o. i obrta?', '2022-06-14 15:27:26', 1, 101),
(80, 'Uvjetni otpust', 'Kada se može tražiti uvjetni otpust ako je osoba osuđena na 18 mjeseci?', '2022-06-14 15:27:47', 1, 138),
(81, 'Zapošljavanje u tvrtci', 'Može li tvrtka poslovati bez zaposlenih?', '2022-06-14 15:29:28', 1, 139),
(82, 'Zatvorska posjeta', 'Tko sve ima pravo zatvoreniku ici u posjetu?', '2022-06-14 15:30:22', 1, 138),
(83, 'Zaštita na radu', 'Tko je obveznik Zakona o zaštiti na radu?', '2022-06-14 15:31:33', 2, 139),
(84, 'Poruke kao dokaz na sudu', 'Mogu li se sms poruke i poruke na Facebook-u koristiti kao dokaz na sudu?', '2022-06-14 15:34:24', 2, 139),
(85, 'Zakoni upravnog prava', 'Koji su zakoni iz područja upravnog prava?', '2022-06-14 15:34:51', 2, 138),
(86, 'Značenje slova A i B u putovnici', 'Koje je značenje slova A i B  koja se utiskuju u putvnicu?', '2022-06-14 15:36:42', 2, 138),
(87, 'Dogradnja garaže', 'Poštovani, \nzanima me što je sve potrebno od dokumentacije za dogradnju garaže?\nLp.', '2022-06-14 15:37:18', 2, 101),
(88, 'Stalni boravak', 'Koliko dugo se u prosjeku čeka na odobrenje za stalni boravak?', '2022-06-14 15:37:54', 2, 138),
(89, 'Zastara za račune', 'Poštovani,zanima me zastara za račune za vodu. Nakon koliko vremena nastupa zastara?', '2022-06-14 15:38:17', 2, 139),
(90, 'Prijepis vlasništva', 'Poštovani,\n\nZanima me ako je vlasništvo 3/1 dali treći član koji ima najmanji dio vlasništva ima pravo tražiti financijski od prva dva vlasnika da mu se isplati dio, da bi se odrekao vlasništva?\n\nHvala na odgovoru, lp.', '2022-06-14 15:40:51', 2, 101),
(91, 'Podizanje osobne iskaznice', 'Koliki je rok za podizanje osobne iskaznice?', '2022-06-14 15:41:16', 101, 138),
(92, 'Kako dobiti dokaze', 'Zanima me,je li obaveza radne organizacije (državna služba) dati mi kopije rasporeda rada unazad tri godine kako bih dokazala kako sam radila u vrijeme koje navodim u svojoj tužbi.', '2022-06-14 15:42:00', 101, 139),
(93, 'Zahtjev za izadvanje osobne iskaznice', 'Zašto na potvrdi o podnijetom zahtjevu za izdavanje osobne iskaznice pise da potvrda vrijedi 30 dana?', '2022-06-14 15:43:01', 101, 138),
(94, 'Prodaja nekretnine', 'Poštovani,\nZanima me na koji se način može prodati nekretnina podijeljena na 4 osobe. Sve četiri osobe žele prodat kuću ali jedna od tih osoba želi blokirat prodaju kazajući da želi prodaju kuće samo ako se proda po njegovoj zamišljenoj cijeni koja je izvan  svakog  normalne osobne procijene.\nHvala na odgovoru, lp.', '2022-06-14 15:44:10', 2, 101),
(95, 'Buka u stubištu', 'Što mozemo napraviti sa susjedima koji svakodnevno namjerno nabijaju po ogradi i stepenicama?', '2022-06-14 15:46:15', 101, 139),
(96, 'Putovanje maloljetnika u inozemstvo', 'Mogu li maloljetnici sami putovati u inozemstvo?', '2022-06-14 15:46:20', 101, 138),
(97, 'Darovanje kuće', 'Poštovani,\n\nRadi se o katu kuće koja još nije upisana u zemljišne knjige, u zemljišnim knjigama se i dalje vodi kao poljana. Kuća ima građevnisku dozvolu, trenutno je u fazi dovršenja, još nije upisana u zemljišne knjige.\nZanima me na koji način on meni može darovati samo taj kat kuće?\n\nHvala na odgovoru,\nlp.', '2022-06-14 15:46:25', 102, 101),
(98, 'Punomoć', 'Za par mjeseci napunit ću 18 godina,te bih trebao za tjedan dana putovati u inozemstvo.\nZanima me trebam li punomoć roditelja ili i bez toga mogu prijeći granicu?', '2022-06-14 15:48:23', 114, 138),
(99, 'Darovni ugovor', 'Poštovani,\n\nU Zk izvatku, ista osoba je upisana za 3/8 vlasništva i i za 1/8 vlasništva.\nKako u tom slučaju napisati darovni ugovor a da ga Zk prihvati?\n\nHvala, lp.', '2022-06-14 15:48:43', 102, 101),
(100, 'Kako saznati je li netko u zatvoru?', 'Na koji način mogu saznati je li netko u zatvoru? Mogu li nazvati zatvor i pitati? Hoće li mi reći ili štite privatnost zatvorenika?', '2022-06-14 15:50:08', 101, 139),
(101, 'Granice katastra', 'Poštovani,\nNedavno smo kupili zemljište i upisali se u katastar i zemljišne knjige. Te iste godine se pored naseg zemljišta gradio novi nogostup. Prilikom njegove izgradnje graditelji su poštivali iskolčenje te ga napravili cca 2m od naše živice. Živica nije stvarna granica našeg zemljišta, nego od nje imamo jos recimo tih 2m.\n\nKome se obratiti da se ovo ispravi? Ucrtano ne prati realno stanje\n\nHvala na odgovoru, lp.', '2022-06-14 15:52:06', 102, 101),
(102, 'Povrat novaca od turistickih agencija', 'Što je na nama da poduzmemo i postoji li neki rok za traženje povrata novca?', '2022-06-14 15:54:13', 106, 139),
(103, 'Brisanje hipoteke', 'Poštovani,\n\nKoliko otprilike treba sudu da obriše hipoteku kad se preda brisovno očitovanje kod javnog bilježnika? Radi se o sudu u Zagrebu.\n\nHvala, lp.', '2022-06-14 15:54:36', 105, 101),
(104, 'HEP i pravoslužnost', 'Poštovani, \nVlasnica sam dviju parcela ,na jednoj ima HEP teret kako pravoslužnost. Vod prolazi po sredini njive i smeta pri obavljanju poljoprivrednih radova, dali mogu tražiti odštetu ili premještaj voda?\n\nHvala na odgovoru, lp.', '2022-06-14 15:57:45', 1, 137),
(105, 'Etažiranje kuće', 'Poštovani,\nKad su mi roditelji umrli ostalo mi po ostavinskoj pola kuće pola bratu. Sada me zanima koliko košta etažiranje kuće sa dva kata?\n\nHvala na odgovoru, lp.', '2022-06-14 15:59:51', 1, 137),
(106, 'Legalizacija objekta', 'Na poljoprivrednom zemljištu (šuma , pašnjak) cca 6500m2 na otoku Korčuli , općina Vela Luka izgrađen je bespravno objekt , kuća cca 90m2 za koju je zatražena legalizacija i postupak je u tijeku.\n\nZanima me , poslije eventualno pozitivne odluke o legalizaciji što se dešava sa zemljištem, odnosno da li ono postaje građevinsko ili mu se status ne mijenja ?', '2022-06-14 16:01:29', 1, 137),
(107, 'Prodaja terase', 'Postovani,\n\nNaš neboder ima 68 stanova i 7 poslovnih prostora u vlasnistvu Grada Zagreba. imamo terasu koja je godinama bila neprohodna i leglo okupljanja smeca i hrane koja je letila iz stanova.\n\nnakon obnove terasa je postala prohodna i s ogradom. pitanje je smiju li stanari kupiti od zgrade svoj dio terase s obzirom da nitko drugi osim njih ne moze doci na terasu, te kako se krecu cijene.', '2022-06-14 16:02:44', 2, 137),
(108, 'Predmeti na dobivenoj čestici', 'Poštovani\n\nZanima me slučaj gdje je proveden postupak uređenja međe, jednoj strani je pripalo 2m zemljišta od druge strane. Druga strana je imala na tom djelu svoje predmete (stupove betonske, drvene) i strana koja je dobila mjerenjem tih 2m prisvojila je i navedene predmete s porukom kao to sam dobio sa zemljom. Da li je to ispravno ?', '2022-06-14 16:03:54', 2, 137),
(109, 'Punomoć', 'Poštovani,\n\nOtac i stric su potpisali ugovor o doživotnom uzdržavanju prije par godina. Sada su napravili aneks tog ugovora te su ga predali na sud radi ovjere te su pozvani da pristupe na ročište. U pozivu piše da umjesto stranke na ročište može pristupiti ovlašteni punomoćnik. Znači li to da se punomoćnik može potpisati u njihovo ime? Može li punomoćnik biti jedna te ista osoba za obojicu i potpisati se u njihovo ime?\n\nHvala na odgovoru, lp.', '2022-06-14 16:06:57', 2, 137),
(110, 'Sudska ovjera', 'Pozdrav,\n\n može li netko ukratko objasniti postupak  kod sudske ovjere ugovora o dosmrtnom uzdržavanju, što treba donijeti kod  prve prijave na sudu?\n\nHvala, lp.', '2022-06-14 16:08:29', 101, 137),
(111, 'Troškovi suda', 'Poštovani,\n\nzanima me kako se računaju troškovi parnice nakon što je tužba dobivena? Ja sam uspio u tužbi 80 %.\n\nOdvjetnik mi je rekao da tuženik plaća 80 % troškova.Što su to točno troškovi parnice, sudski troškovi, ili troškovi suda i odvjetnika zajedno?\n\nI kako se obračunavaju odvjetnički troškovi, po kojoj tarifi?\n\nHvala na odgovoru, lp.', '2022-06-14 16:11:44', 101, 137),
(112, 'Kako upisati zamijenjenu nekretninu?', 'Poštovani,\n\nimam nekoliko pitanja za vas. Moj otac je za vrijeme rata zamijenio zemljište u Banjoj Luci za nedovršenu vikend kuću u blizini Šibenika. On tu nekretninu nije upisao na sebe,a nedavno je umro. Brat i ja smo naslijedili tu kuću u istim dijelovima. Kako nekretninu upisati na nas s obzirom da imamo samo ugovor o zamjeni. Podnijela sam i zahtjev za legalizaciju ove nekretnine. \n\nHvala', '2022-06-14 16:15:37', 101, 137),
(113, 'Dokazivanje vanbračne zajednice', 'Poštovani,\nmolim vas ako znate kakve dokaze se treba imati da se u izvanparničnom postupku dokaže izvanbračna zajednica koja je trajala devet godina i rođeno je zajedničko dijete koje sada ima sedam god, izvanbračna zajednica je prestala zbog smrti izvanbračnog druga.', '2022-06-14 16:17:56', 109, 137),
(114, 'Početak zastare', 'Kada i kako nastupa zastara?', '2022-06-14 19:58:37', 1, 137),
(115, 'Preplata', 'Kako se računa preplata režija i mogu li dobiti povrat novca ustanovim li da je došlo do preplate?', '2022-06-14 23:56:07', 2, 137);
